import React, { useState, useEffect } from "react";
import { Nav, Navbar, Button } from "react-bootstrap";
import * as moment from "moment";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCalendarAlt, g } from "@fortawesome/free-solid-svg-icons";

const TopNavigation = () => {
  const currentDate = moment().format("MMMM Do YYYY");

  return (
    <Navbar bg="light" expand="lg" className="fixed-top shadow flexible-navbar">
      {/* <Navbar.Brand href="#home" className="col-sm-3 col-md-2 mr-0">React-Bootstrap</Navbar.Brand> */}
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">Link</Nav.Link>
        </Nav>
        <Button href="#" variant="outline-info" disabled style={{pointEvents: 'none'}}>
          <FontAwesomeIcon icon={faCalendarAlt} className="mr-2" />
          {currentDate}
        </Button>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNavigation;
